// frontend/src/components/Reservations.js

import React from 'react';

const Reservations = ({ reservations }) => {
    return (
        <div>
            <h2>Reservations for My Accommodations</h2>
            {reservations.map((reservation) => (
                <div key={reservation._id} className="reservation-item">
                    <p><strong>User:</strong> {reservation.user.username}</p>
                    <p><strong>Accommodation:</strong> {reservation.accommodation.title}</p>
                    <p><strong>Check-in:</strong> {reservation.checkInDate}</p>
                    <p><strong>Check-out:</strong> {reservation.checkOutDate}</p>
                    <button onClick={() => handleDeleteReservation(reservation._id)}>Delete</button>
                </div>
            ))}
        </div>
    );
};

export default Reservations;
